adj = read_matrix();
test=sparse(adj);
n=length(adj);

n_tri = 0;
for i=1:n
    for j=1:n
        for k=1:n
            n_tri = n_tri + (adj(i,j)*adj(k,i)*adj(j,k));
        end
    end
end
n_all_tri=0;
for i=1:n
    sum = 0;
    for j=1:n
        sum = sum + adj(i,j);
    end
    n_all_tri = n_all_tri + sum*(sum-1);
end

format long g;
disp(n_tri/n_all_tri);

%Spread points
phi = 0:2*pi/n:2*pi*(1-1/n);
xy = [cos(phi);sin(phi)];
xy = transpose(xy);

figure(1);
gplot(adj,xy,'-*');
title('Small World Network Example');
line = [];

%Distance
%{
dist = zeros(n,n);
for i=1:(n-1)
    c=0;
    for j=(i+1):n
        if adj(i,j) == 1;
            dist(i,j) = 1;
            dist(j,i) = 1;
            line = [line j];
            c = c+1;
        end
    end
    aux = line;
    line = [];
    it = 2;
    while(c<(n-i))
        for j=1:length(aux)
            for k=(i+1):n
                if adj(aux(j),k)==1 && dist(i,k)==0
                    dist(i,k) = it;
                    dist(k,i) = it;
                    line = [line k];
                    c = c+1;
                end
            end
        end
        aux=line;
        line=[];
        it = it+1;
    end
end
%}

%Distance
dist = adj;
for i=1:n
        for j=1:n
            if dist(i,j) == 0 && i~=j 
                dist(i,j) = Inf; 
            end
        end
end

for k=1:n
    for i=1:n
        for j=1:n
            dist(i,j) = min(dist(i,j),dist(i,k)+dist(k,j));
        end
    end
end

len=0;
for i=1:n
    for j=1:n
            len = len + dist(i,j);
    end
end

disp(len/(n*(n-1)));


